import React from 'react';
import AdList from './AdList'
import { makeStyles, useTheme } from '@material-ui/core/styles';

export default function ManagAds (props){
return (
    <div>
        { 
          props.setGarage.map(item => (
            <AdList props={item} />
          ))
        }
    </div>
)
}
